import React from "react";
import "../styles/css/Footer.css";
export default function Footer() {
  return (
    <div className="col-xs-12" id="footer">
      <div className="maxWidth">
        <div className="row">
          <div className="col-sm-4 col-xs-12"></div>
          <div className="col-sm-4 col-xs-12"></div>
          <div className="col-sm-4 col-xs-12"></div>
        </div>
        <hr className="hr" />
        <div className="row">b</div>
      </div>
    </div>
  );
}
